




drop table visit_view;
CREATE OR REPLACE VIEW visit_view AS 
 SELECT visits.visit_id,
    visits.user_id,
    visits.city_id,
    visits.state_id,
    userdata.first_name,
    userdata.last_name,
    city.city_name,
    state.state_name,
    state.abbreviation,
    visits.date_visited,
    visits.date_time_added,
    visits.lastupdated
   FROM visits,
    city,
    state,
    userdata
  WHERE visits.city_id = city.city_id AND visits.state_id = state.state_id AND userdata.user_id = visits.user_id;






